function dropDown(){document.querySelector("navbar_def_dropdown_btn").classList.toggle("show")}window.onclick=function(n){if(!n.target.matches(".navbar_def_dropdown_btn")){let n,o=document.getElementsByClassName("navbar_def_dropdown_btn_content");for(n=0;n<o.length;n++){let t=o[n];t.classList.contains("show")&&t.classList.remove("show")}}};